# 1. Hex 문자열을 바이트로 변환
data = bytes.fromhex(hex_dump.replace('\n', ' ').replace(' ', ''))

# 2. Key 설정 (133739591337을 Hex Byte로 해석)
key = bytes([0x13, 0x37, 0x39, 0x59, 0x13, 0x37])

# 3. XOR 복호화
decoded = bytearray()
for i in range(len(data)):
    decoded.append(data[i] ^ key[i % len(key)])

# 4. 결과 출력
print("--- Decoded Source Code ---")
print(decoded.decode('utf-8'))